import React, { useState } from 'react'
import { Link } from 'react-router-dom';

function Navmax() {
    const [isopen, setOpen] = useState(false);
    const Openmenu = () => {
        setOpen(!isopen);
    }
    return (
        <div>
            <div>
                <div className='burger' onClick={Openmenu}>
                    <div className='linee'></div>
                    <div className='linee'></div>
                    <div className='linee'></div>
                </div>
                <div><span>XFUTUR</span></div>
                <div>
                    <button>Sign in</button>
                </div>
            </div>
            {isopen && (
                <div className='burger_menu'>
                    <Link to="/">LINK</Link>
                    <Link to="/">LINK</Link>
                    <Link to="/">LINK</Link>
                </div>
            )}
        </div >
    )
}

function Navmin() {
    return (
        <div>
            <span>XFUTUR</span>
            <div>
                <Link to="/">LINK</Link>
                <Link to="/">LINK</Link>
                <Link to="/">LINK</Link>
            </div>
        </div>
    )
}

function Nav() {
    const checkwidth = window.matchMedia("(min-width: 500px)") <= 500;
    return (
        <div>
            {checkwidth ? <Navmax /> : <Navmin />}
        </div>
    )
}

export default Nav
